import React from 'react';

import Navbar from "./Navbar/Navbar";
import Categories from "./Categories/Categories";
import Adverts from "./Adverts/Adverts";
import Footer from "./Footer/Footer";

const MainPage = () => {
  return (
      <div>
        <Categories/>
        <Adverts/>
        <Footer/>
      </div>
  );
};

export default MainPage;
